import { createSlice } from "@reduxjs/toolkit";
import db from "../../db";

export const productsSlice = createSlice({
  name: "products",
  initialState: {
    value: db.products,
  },
  reducers: {},
});

// Action creators are generated for each case reducer function


export default productsSlice.reducer;
